%python
import os

training_map = {
    'breaker_box': [],
    'sump_pump': [],
    'washer': []
}

import copy
validation_map = copy.deepcopy(training_map)

category_to_idx = {
    'breaker_box': 0,
    'sump_pump': 1,
    'washer': 2
}

def counts(data_dir, map):
  counter = 0
  for root, dirs, files in os.walk(data_dir):
    category = root.split("/")[-1]
    for f in files:
      map[category].append({
        'idx': counter,
        'label': category_to_idx[category],
        'filename': f,
        'filepath': root + '/' + f
      })
    counter += 1

counts('/data/household/train/', training_map)
counts('/data/household/validation/', validation_map)

print("%table type\tclass\tcount")
for k in training_map:
    print("train\t" + k + "\t" + str(len(training_map[k])))

for k in validation_map:
    print("validation\t" + k + "\t" + str(len(validation_map[k])))
